contracts/multi-signwallet.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

//in this we create a signature in which when user want to send some ether to other he need
//confirmation from multi-address.

contract MultiSig{

//this is multi account owner.
    address[] public owners;
    //this is total number of owner confirm the transaction.
    uint public numConfirmationRequired;

    struct Transaction{
        address to;
        uint value;
        bool executed;
    }
    mapping (uint=>mapping (address=>bool)) isConfirmed;

    //in this we make transaction of type Transaction and make it array so we can store multiple struct.
    Transaction[] public transactions;

    event TransactionSubmitted(uint transactionId,address sender, address receiver, uint amount);
    event TransactionConfirmed(uint transactionId);

    constructor(address[] memory _owners, uint _numConfirmationRequired){
        require(_owners.length>1,"kindly increase number of owners");
        require(_numConfirmationRequired>0 && _numConfirmationRequired <= _owners.length, "Confirmation must be equal or less the owners");

        for (uint i=0; i<_owners.length; i++){
            require(_owners[i]!=address(0),"invalid address");
            owners.push(_owners[i]);
        }
        numConfirmationRequired= _numConfirmationRequired;
    }

//in this function we are not making transfer, we are just send the transaction to transactions.
    function submitTransaction(address _to) public payable {
        require(_to!=address(0),"Invalid receiver address");
        require(msg.value>0,"Amount must be more than 0");

        uint transactionsId = transactions.length;
        //in this we are submiting the details of pending transaction in transactions array.
        //and this push will increase the lenght of array.
        transactions.push(Transaction({to: _to , value : msg.value , executed : false }));
        //this will print the log that transaction is submitted with this id.
        emit TransactionSubmitted(transactionsId,msg.sender, _to, msg.value);
    }

    function confirmTransaction(uint _transactionId) public {
        //because transactions lenght is like 4 (total number) but its array start with 0 if we write 4 then not correct max we can use 3 on lenght 4.
        require(_transactionId < transactions.length, "invalid transaction id");
        //this will ensure that this address with this transaction id is confirmed or not(by bool true or false.
        //if its false then go nexr
        require(!isConfirmed[_transactionId][msg.sender], "Transaction already confirmed");
        //this mean this addrss with this id give confirmation so we assign it true.
        isConfirmed[_transactionId][msg.sender]=true;
        emit TransactionConfirmed(_transactionId);

    }

    function isTransactionConfirmed(uint transactionId) public view returns(bool){
        require(transactionId < transactions.length, "invalid transaction id");
        uint confirmationcount;

        for(uint i=0; i<owners.length; i++){
            if(isConfirmed[transactionId][owners[i]]){
                confirmationcount++;
            }
        }
        return confirmationcount>=numConfirmationRequired;
    }


}

